import React from 'react';
import logo from './logo.svg';
import './App.css';
import getGifs from './services/getGifs.js';


class App extends React.Component {
  state = {
      gifs: []
  }

  componentDidMount(){
    const gifs = getGifs({ keyword: 'panda' });
    console.log("1: ", gifs)
    this.setState({ gifs: gifs });
  }

  render (){
      return (
        <div className="App">
          <section className="App-content">
            {
              this.state.gifs.map(singleGif => {
                const {title, id, url} = singleGif;
                return (<div>
                  <h5>{title}</h5>
                  <small>{id}</small>
                  <img src={url} />
                </div>)
              })
            }
           </section >
        </div>
       );
    }
}

export default App;
